import js from '@eslint/js';
import prettier from 'eslint-config-prettier';
import globals from 'globals';
import ts from 'typescript-eslint';

/** @type {import('eslint').Linter.Config[]} */
export default [
  js.configs.recommended,
  ...ts.configs.recommended,
  prettier,
  {
    languageOptions: {
      globals: {
        ...globals.browser,
        ...globals.node,
      },
    },
  },
  { ignores: ['**/*.js', '**/dist/'] },
  {
    rules: {
      '@typescript-eslint/no-explicit-any': 'off',
    },
  },
];

import { defineConfig, presetUno } from 'unocss';

export default defineConfig({
  content: {
    filesystem: ['src/**/*.{html,js,ts,jsx,tsx,vue,svelte,astro}'],
  },
  presets: [presetUno()],
});

import { readFile } from 'fs/promises';
import { join } from 'path';

export function versionLoader(pkgDir: string) {
  /**
   * @param {string} module must be a resolvable path
   */
  return async function getVersion(module: string) {
    const packageJson = JSON.parse(
      await readFile(
        join(pkgDir, 'node_modules', module, 'package.json'),
        'utf8',
      ),
    );
    return packageJson.version;
  };
}
